// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AnchorRegistry {
    event Anchored(bytes32 indexed recordHash, bytes32 indexed recordId, address indexed owner, uint256 timestamp, string meta);
    function anchor(bytes32 recordHash, bytes32 recordId, string calldata meta) external {
        emit Anchored(recordHash, recordId, msg.sender, block.timestamp, meta);
    }
}

